from ai_utils.phases.abstract_phase import AbstractPhaseClass
from ai_utils.utils.fileutils import FileUtilsClass
import os
import logging
import base64
import subprocess
import string
import random

class SavePayloadToAlternateStreamPhaseClass(AbstractPhaseClass):
    TrackerId = "354"
    Subject = "Save Executable Code to a File's Alternate Stream and Reset its Time Stamp"
    Description = "Save Executable Code to a File's Alternate Stream and Reset its Time Stamp"
    # Encoded binary executes: ping 8.8.8.8
    attackiq_default_binary = ''

    def __init__(self, isPhaseCritical, strFileName, strStreamName='', strBinary=''):
        AbstractPhaseClass.__init__(self, isPhaseCritical)
        logging.info('Executing SavePayloadToAlternateStream phase...')
        # here we don't use basestring (str and unicode) because in py3 basestring does not exists. We lose some performance.
        assert isinstance(strFileName, type('')) or isinstance(strFileName, type(u''))
        assert isinstance(strStreamName, type('')) or isinstance(strStreamName, type(u''))
        assert isinstance(strBinary, type('')) or isinstance(strBinary, type(u''))
        self.Timestamps = {'Access' : None, 'Modification' : None}
        self.strFileName = strFileName
        tmpStreamName = 'ai-' + ''.join(random.choice(string.ascii_uppercase + string.ascii_lowercase + string.digits)\
                                     for _ in range(10))
        self.strStreamName = strStreamName if strStreamName else tmpStreamName
        self.binary = strBinary if strBinary else self.attackiq_default_binary

    def _get_timestamp(self):
        success = False
        try:
            st = os.stat(self.strFileName)
            """
            st_atime - time of most recent access,
            st_mtime - time of most recent content modification,
            st_ctime - platform dependent; time of most recent metadata change on Unix, or the time of creation on Windows)
            The c_time property won't be changed.
            """
            self.Timestamps['Access'] = st.st_atime
            self.Timestamps['Modification'] = st.st_mtime
            success = True
        except Exception as e:
            logging.error("File timestamp could not be retrieved. File timestamp won't be restored. Error: {0}".format(e))
        return success

    def _hide_binary(self):
        self.PhaseReporter.Info('Hiding file in alternate stream...')
        success = False
        streamName = "{0}:{1}".format(self.strFileName, self.strStreamName)
        if not os.path.exists(streamName):
            binary_content = base64.b64decode(self.binary)
            with open(streamName, 'wb') as fd:
                fd.write(binary_content)
            success = True
            self.PhaseReporter.Info('File was correctly hidden in alternate stream: {0}'.format(streamName))
        else:
            logging.error("An alternate stream with the same name already exist.")
        return success

    def _restore_timestamp(self):
        success = False
        if self.Timestamps['Access'] and self.Timestamps['Modification']:
            try:
                os.utime(self.strFileName,(self.Timestamps['Access'],self.Timestamps['Modification']))
                success = True
            except Exception as e:
                logging.error("File timestamp could not be retrieved. File timestamp won't be restored. Error: {0}".format(e))
        return success

    def ManualCleanup(self):
        fileToRemove = '{0}:{1}'.format(self.strFileName, self.strStreamName)
        success = FileUtilsClass.DeleteFile(fileToRemove)
        if not success:
            self.PhaseReporter.Warn('Alternate stream could not be deleted: {0}'.format(fileToRemove))
        return success

    def Setup(self):
        return FileUtilsClass().FileExists(self.strFileName)

    def Run(self):
        if self._get_timestamp():
            logging.info('Initial \'access\' and \'last modified date\': {0}'.format(self.Timestamps))
        else:
            logging.info('Initial \'access\' and \'last modified date\' could not be retrieved')

        phaseResult = self._hide_binary()

        if self._restore_timestamp():
            self.PhaseReporter.Info('File timestamps modified and restored to: {0}'.format(self.Timestamps))
        else:
            self.PhaseReporter.Info('Initial \'access\' and \'last modified date\' could not be restored to their initial value')

        # Phase is successful if alternate stream could be stored
        if phaseResult:
            self.PhaseResult['AlternateStream'] = '{0}:{1}'.format(self.strFileName, self.strStreamName)
            self.PhaseReporter.Info('Successfully stored binary in alternate stream.')
            self.PhaseReporter.Report('A base64 encoded binary was stored in an alternate stream')
        else:
            self.PhaseReporter.Info('Failed to store binary in alternate stream.')
        return phaseResult


class ExecutePayloadFromAlternateStreamPhaseClass(AbstractPhaseClass):
    TrackerId = "355"
    Subject = "Execute binaries hidden in alternate streams"
    Description = "Execute binaries hidden in alternate streams"

    def __init__(self, isPhaseCritical, strFileName, strStreamName):
        AbstractPhaseClass.__init__(self, isPhaseCritical)
        logging.info('Executing ExecutePayloadFromAlternateStream phase...')
        self.strFileName = strFileName
        self.strStreamName = strStreamName

    def _execute_binary_stream(self):
        self.PhaseReporter.Info('Executing alternate stream...')
        success = False
        binary_stream = "{0}:{1}".format(self.strFileName, self.strStreamName)
        try:
            if os.path.exists(binary_stream):
                # We use wait() to stop execution until executed binary finishes. This can be modified.
                subprocess.Popen([binary_stream]).wait()
                success = True
            else:
                logging.error('Alternate stream {0} does not exist.'.format(binary_stream))
        except Exception as e:
            logging.error('File "{0}" could not be executed": {1}'.format(binary_stream, e))
        return success

    def Setup(self):
        return FileUtilsClass().FileExists(self.strFileName)

    def Run(self):
        phaseResult = self._execute_binary_stream()
        if phaseResult:
            self.PhaseResult['AlternateStream'] = '{0}:{1}'.format(self.strFileName, self.strStreamName)
            self.PhaseReporter.Info('Successfully executed binary from alternate stream.')
        else:
            self.PhaseReporter.Info('Failed to execute binary from alternate stream.')
        return phaseResult
